import mindspore as ms
import torch

param_torch = torch.load("v2-1_512-ema-pruned.ckpt")['state_dict']
param_ms = ms.load_checkpoint("stable_diffusion_v2.ckpt")
new_dict = []

for torch_name, ms_name, dtype in info_list:
    if torch_name in param_torch.keys() and ms_name in param_ms.keys():
        if dtype==" dtype=Float32":
            new_dict.append({
                "name": ms_name,
                "data": ms.Parameter(ms.Tensor(param_torch[torch_name].numpy(), ms.float32), requires_grad=True, name=ms_name)
            })
        elif dtype==" dtype=Float16":
            new_dict.append({
                "name": ms_name,
                "data": ms.Parameter(ms.Tensor(param_torch[torch_name].numpy(), ms.float16), requires_grad=True, name=ms_name)
            })
        else:
            print("unkonw dtype", dtype)
    else:
        print(torch_name, ms_name, dtype)

for item in new_dict:
    print(item["name"], item["data"])

ms.save_checkpoint(new_dict, "converted_weight.ckpt")


